import React from 'react';
import { Provider } from 'react-redux';
import './App.scss';
import store from "./store";
import 'bootstrap/dist/css/bootstrap.min.css';

//components 
import Search from "./components/search/search.js"

function App() {
  return (
      <div className="app">
          <Provider store={store}>
            <Search/>
         </Provider>
      </div>

  );
}

export default App;
